class Solution {

    /**
     * @param Integer[] $nums
     * @return Integer[]
     */
    function numberGame($nums) {
        $arr = [];
        while (!empty($nums)) {
            sort($nums); // Sort $nums to get the minimum elements at the start
            $alice = array_shift($nums); // Alice removes the minimum element
            $bob = array_shift($nums); // Bob removes the next minimum element
            array_unshift($arr, $alice); // Alice appends her element to $arr
            array_unshift($arr, $bob); // Bob appends his element to $arr, before Alice's element
        }
        return array_reverse($arr); // Reverse $arr to get the final order
    }
}
